use strict;
use warnings;
use Net::Pcap;

my $pcap_file = 'test.pcap';

# Open the PCAP file for reading
my $pcap = Net::Pcap::open_offline($pcap_file, \$err);
if (not defined $pcap) {
    die "Can't open PCAP file: $err\n";
}

# Compile a filter to capture all packets
my $filter;
Net::Pcap::compile($pcap, \$filter, "tcp or udp", 1, 0);
Net::Pcap::setfilter($pcap, $filter);

# Loop through each packet in the file
Net::Pcap::loop($pcap, -1, \&process_packet, '');

# Close the PCAP file
Net::Pcap::close($pcap);

sub process_packet {
    my ($user_data, $header, $packet) = @_;

    # Decode each layer of the packet
    my $ether = Net::Frame::Layer::ETH->new(raw => $packet);
    my $ip = Net::Frame::Layer::IPv4->new(raw => $ether->payload);
    my $tcp = Net::Frame::Layer::TCP->new(raw => $ip->payload);

    # Print the contents of each layer
    print "Ethernet:\n";
    print "  Source MAC: " . $ether->src() . "\n";
    print "  Destination MAC: " . $ether->dst() . "\n";
    print "\n";

    print "IP:\n";
    print "  Source IP: " . $ip->src() . "\n";
    print "  Destination IP: " . $ip->dst() . "\n";
    print "\n";

    print "TCP:\n";
    print "  Source port: " . $tcp->src() . "\n";
    print "  Destination port: " . $tcp->dst() . "\n";
    print "\n";
}

