% 生成原始信号
fs = 1000; % 采样频率
T = 1 / fs; % 采样时间间隔
N = 1024; % 采样点数
t = (0 : N - 1) * T; % 时间序列
f1 = 70; % 正弦波频率
x = sin(2 * pi * f1 * t); % 原始信号

% 对信号进行fft变换
X = fft(x);

% 不同采样点数下的信号恢复
N1 = 512;
X1 = [X(1 : N1 / 2 + 1), X(N - N1 / 2 + 1 : N)] * N1 / N;
x1 = ifft(X1);
t1 = (0 : N1 - 1) * T;

N2 = 256;
X2 = [X(1 : N2 / 2 + 1), X(N - N2 / 2 + 1 : N)] * N2 / N;
x2 = ifft(X2);
t2 = (0 : N2 - 1) * T;

N3 = 128;
X3 = [X(1 : N3 / 2 + 1), X(N - N3 / 2 + 1 : N)] * N3 / N;
x3 = ifft(X3);
t3 = (0 : N3 - 1) * T;

