module add (
    input [31:0] a,
    input [31:0] b,
    output [31:0] result
);

module full_adder (
    input a, b, carry_in,
    output sum, carry_out
  );

  assign sum = a ^ b ^ carry_in;
  assign carry_out = (a & b) | (carry_in & (a ^ b));

endmodule

module adder (
    input [31:0] a,
    input [31:0] b,
    output [31:0] sum
  );

  wire carry_in, carry_out;
  wire [31:0] temp_sum[31:0];
  assign temp_sum[0] = a[0] ^ b[0] ^ carry_in;

  full_adder adder_i1 (
    .a(a[1]), .b(b[1]), .carry_in(carry_in),
    .sum(temp_sum[1]), .carry_out(carry_out)
  );

  ...

  full_adder adder_i31 (
    .a(a[31]), .b(b[31]), .carry_in(carry_in),
    .sum(temp_sum[31]), .carry_out(carry_out)
  );

  assign sum = temp_sum;

endmodule

