clear all; close all;

N = 100000;      %模拟入射粒子的总数目
theta_max = pi;  %散射角度的最大值
r_min = 0.1;     %与原子核的最小距离，可以根据实际情况进行调整

%生成随机的初始位置和速度
x0 = zeros(N,3);
v0 = zeros(N,3);
v0(:,3) = randn(N,1);  %z方向速度为随机值
v0 = v0./sqrt(sum(v0.^2,2)); %归一化
theta = (rand(N,1)-0.5)*theta_max;  %随机生成散射角度
phi = rand(N,1)*2*pi;   %随机生成方位角
v0(:,1) = sin(theta).*cos(phi);
v0(:,2) = sin(theta).*sin(phi);

%求解径向运动方程
dt = 0.01;
t = (0:dt:10)';
x = zeros(N,3,length(t));
v = zeros(N,3,length(t));
x(:,:,1) = x0;
v(:,:,1) = v0;
for i=2:length(t)
    a = -x(:,:,i-1)./sum(x(:,:,i-1).^2,2).^(3/2);
    v(:,:,i) = v(:,:,i-1) + a*dt;
    x(:,:,i) = x(:,:,i-1) + v(:,:,i)*dt;
end

%统计散射粒子数目和散射角度
N_scattered = sum(sum(sqrt(sum(x.^2,3))<r_min));
theta_scattered = acos(v(:,3,end));
figure;hist(theta_scattered,100);
title(sprintf('Scattered particles=%d, theta_max=%.2f, r_min=%.2f', N_scattered, theta_max, r_min));
xlabel('Scattering angle');ylabel('Count');

