% 给定点的坐标
point1 = [x1, y1]; % 替换 x1, y1 为第一个点的坐标
point2 = [x2, y2]; % 替换 x2, y2 为第二个点的坐标
point3 = [x3, y3]; % 替换 x3, y3 为第三个点的坐标

% 设置圆心到点2的距离
fixed_distance = 1; % 替换为您需要的特定距离值

% 计算直线的方向向量
v1 = point2 - point1;
v1 = v1 / norm(v1);
v2 = point3 - point2;
v2 = v2 / norm(v2);

% 计算垂直于线段的单位向量
v = ((v2(1) * v1(2)) - (v1(1) * v2(2))) / ((v1(1) * v2(1)) + (v1(2) * v2(2)));

% 计算圆心坐标
circle_center = (point1 + point2)/2 + fixed_distance * v * [v1(2), -v1(1)];

% 计算圆弧起始角度和终止角度
start_angle = atan2(point1(2) - circle_center(2), point1(1) - circle_center(1));
