proc fib_iterative {n} {
    if {$n <= 1} {
        return $n
    }
    set a 0
    set b 1
    for {set i 2} {$i <= $n} {incr i} {
        set c [expr {$a + $b}]
        set a $b
        set b $c
    }
    return $b
}

